import { FC } from "react";
import styles from "./index.module.scss";
import user from "../../../images/icons/user.svg";

type Props = {
  data: {
    id: number;
    img: string;
    title: string;
    sleeps: number;
    type_bed: string;
  };
};

export const RoomCard: FC<Props> = ({ data }) => {
  return (
    <div className={styles.room}>
      <img src={data.img} alt="" />
      <h4>Мужская комната на 6 человек</h4>
      <div>
        <div className={styles.sleeps}>
          <img src={user} alt="" />
          <span>{data.sleeps} спальных мест</span>
        </div>
        <div className={styles.bunk}>двухъярусная кровать</div>
      </div>
      <a href="">Увидеть больше</a>
    </div>
  );
};
